import React, {useState, useEffect} from 'react';
import { Route } from 'react-router-dom'

function ListElement ({cur}) {

    const elemStyle={
        width: 300,
        height: 300,
        backgroundColor: 'yellow'
    }

    const imageStyle={
        width: 100,
        height:100,
        backgroundColor:'blue'
    }

    return (
        <div  
            className="Container"
            style={elemStyle}
            >
            {/* <h2>{cur.NAME}</h2>
            <img 
                src={cur.PICTURE}
                style={imageStyle}
            />
            <p>{cur.DETAIL}</p> */}
        </div>
    )
}
export default ListElement;
